/**
 * 表示游戏地图的数据结构。
 */
class map
{
    /**
     * 地图索引。
     */
    public Index: number;

    /**
     * 地图宽度。
     */
    public Width: number;

    /**
     * 地图高度。
     */
    public Height: number;

    /**
     * Back 图层数据 (二维数组: row[height][col])
     */
    public BackLayerData: number[][];

    /**
     * Buildings 图层数据
     */
    public BuildingsLayerData: number[][];

    /**
     * Front 图层数据
     */
    public FrontLayerData: number[][];

    /**
     * 从二进制数据解析地图。
     * @param view 包含地图数据的 DataView
     */
    constructor(view: DataView)
    {
        // 初始化偏移量
        let offset = 0;

        // 读取头部信息
        this.Index = view.getUint8(offset); offset += 1;
        this.Width = view.getUint8(offset); offset += 1;
        this.Height = view.getUint8(offset); offset += 1;
        offset += 1;

        // 初始化二维数组
        this.BackLayerData = this.create2DArray(this.Height, this.Width);
        this.BuildingsLayerData = this.create2DArray(this.Height, this.Width);
        this.FrontLayerData = this.create2DArray(this.Height, this.Width);

        // 循环读取层数据
        const layers = [this.BackLayerData, this.BuildingsLayerData, this.FrontLayerData];

        for (const layer of layers)
        {
            for (let i = 0; i < this.Height; i++)
            for (let j = 0; j < this.Width; j++)
            {
                layer[i][j] = view.getUint16(offset, true);
                offset += 2;
            }
        }
    }

    /**
     * 创建并初始化一个二维数组
     */
    private create2DArray(rows: number, cols: number): number[][]
    {
        const arr = new Array<number[]>(rows);
        for (let i = 0; i < rows; i++)
            arr[i] = new Array<number>(cols);

        return arr;
    }
}

